import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Switch>
        <ul>
          <Route>
            <li>Menu</li>
          </Route>
          <Route>
            <li>Our food</li>
          </Route>
          <Route>
            <li>Contact</li>
          </Route>
          <Route>
            <li>Map</li>
          </Route>
        </ul>
      </Switch>
    </div>
  );
}

export default App;
